This bitfield define the ACMP output digital filter mode:
000-bypass
100-change immediately;
101-change after filter;
110-stalbe low;
111-stable high

00: direct mode, DAC output the fixed configured data(from sw_dac_data)
01: step mode, DAC output from start_point to end point, with configured step, can step up or step down
10: buffer mode,  read data from buffer, then output to analog, internal DMA will load next burst if enough space in local FIFO;

set to reset dma read pointer to buf1_start_addr;
if set both dma_rst0&dma_rst1, will set to buf0_start_addr
user can set fifo_clr bit when use dma_rst*

TXFIFO for sending message to other core, FIFO size, 4x32
can write one of the word address to push data to the FIFO;
can also use 4x32 burst write from 0x010 to push 4 words to the FIFO.

RXFIFO for receiving message from other core, FIFO size, 4x32
can read one of the word address to pop data to the FIFO;
can also use 4x32 burst read from 0x020 to read 4 words from the FIFO.

